import './App.css';
import "leaflet/dist/leaflet.css";
import { Container, Row} from 'react-bootstrap';
import Col from 'react-bootstrap/Col';
function App() {
  return (
    <>
      <header>
        <Container fluid="sm">
          <Row>
            <Col xs={12} sm={8}>COVID-19 TRACKER</Col>
            <Col xs={12} sm={4}><h1>COVID-19 TRACKER</h1></Col>
          </Row>
        </Container>
      </header>
    </>
  );
}
export default App;
